import Layout from '../components/MyLayout.js'
import Link from 'next/link'
import FirstPage from './index'



export default function Blog() {
  return (
    <Layout>
      <h1>My Blog</h1>
      <ul>
       
      </ul>
      <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
    </Layout>
  )
}
